import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom"
import { GoalList } from "./goalist/GoalList"

export const YIR = () => {
  const [goals, setGoalList] = useState([])

  useEffect(() => {
    GoalList()
    .then((data) => {
      setGoalList(data);
    });
  },[]);

  return (
  <>

        {
            goals.map((goalObj) => {
              return (
                    <div>
                      <Link to={`/goals/${goalObj.id}`}>

                      </Link>
                    </div>
                )
            })
        }

  </>

  );
};
